import "./Login.css";
import React, { Component } from "react";
import { Container, Row } from "react-bootstrap";

class Login extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: "",
      email: "",
      password: "",
    };
  }

  render() {
    return (
      <Container>
        <Row>
          <img
            className="linkedin-img rounded mx-auto d-block"
            src="https://www.logo.wine/a/logo/LinkedIn/LinkedIn-Logo.wine.svg"
            alt="linkedin logo"
          />
        </Row>
        <Row style={{marginTop:"-80px"}}>
          <span>Make the most of your professional life</span>
        </Row>
      </Container>
    );
  }
}

export default Login;
